import React from 'react';
import './index.css';

export default function App() {
  const users = [
    ["Name", "Surname", Age, "Location"],
    ["Kabo", "Makgatho", 7, "Lebowakgomo"],
    ["Julia", "Masipa", 62, "Midrand"],
  ];
return (
    <div>
     <table>
       <thead>
         <tr>
           {users[0].map((item, index) => {
             return <th>{item}</th>;
           })}
         </tr>
       </thead>
       <tbody>
         {users.slice(1, users.length).map((item, index) => {
          return(
            <tr>
              <td>{item[0]}</td>
              <td>{item[1]}</td>
              <td>{item[2]}</td>
            </tr>
          );
  })}
       </tbody>
     </table>
</div>
);
}
